import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { Suspense } from 'react';
import AdminDash from '../pages/admindash/admindash';
import Adminprofile from '../pages/adminprofile/adminprofile';
import RegisterParticipant from '../pages/registration/register';
import Plan from '../pages/plan/plan';
import SubscriptionsReport from '../pages/subscriptionsreport.jsx/subscriptionreport';
import Inventory from '../pages/inventory/inventory';
import Addinventory from '../pages/inventory/addinventory/addinventory';
import ActiveMembers from '../pages/membres/activemembres';
import Coaches from '../components/coaches/coaches';
import Coachess from '../pages/coaches/coaches';
import RegisterAdminForm from '../pages/registration_admin/register';
import SalesReport from '../pages/report/report';
import LoginPage from '../pages/loginscreen/home';

function AllRoutes() {
  return (
    <Suspense fallback={<>Loading...</>}>
      <Router>
        <Routes>
        <Route exact path="/home" element={<AdminLayout><AdminDash /></AdminLayout>} />
          <Route exact path="/adminprofile" element={<AdminLayout><Adminprofile /></AdminLayout>} />
          <Route exact path="/registration" element={<AdminLayout><RegisterParticipant /></AdminLayout>} />
          <Route exact path="/plan" element={<AdminLayout><Plan /></AdminLayout>} />
          <Route exact path="/subscription" element={<AdminLayout><SubscriptionsReport /></AdminLayout>} />
          <Route exact path="/report" element={<AdminLayout><SalesReport /></AdminLayout>} />
          <Route exact path="/inventory" element={<AdminLayout><Inventory /></AdminLayout>} />
          <Route exact path="/inventory/add" element={<AdminLayout><Addinventory /></AdminLayout>} />
          <Route exact path="/viewmembres" element={<AdminLayout><ActiveMembers /></AdminLayout>} />
          <Route exact path="/coaches" element={<AdminLayout><Coachess /></AdminLayout>} />
          <Route exact path="/admin/register" element={<AdminLayout><RegisterAdminForm /></AdminLayout>} />
        </Routes>
      </Router>
    </Suspense>
  );
}

export default AllRoutes;
